import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { SemanticService } from '../semantic.service';
@Component({
  selector: 'app-result',
  templateUrl: './result.component.html',
  styleUrls: ['./result.component.css']
})
export class ResultComponent implements OnInit {
  resultData: any;

  constructor(private route: ActivatedRoute,private semanticService: SemanticService) {}

  ngOnInit() {
    this.resultData = history.state.data;
    console.log('Result Data received from the submit:', this.resultData);
  }
  confirm(resource: any) {
    // Assuming you have an endpoint named 'confirmResource' in your SemanticService
    // Adjust the endpoint name as per your actual service
    this.semanticService.confirmResource({
      surfaceForm: resource['@surfaceForm'],
      arrivalDate: resource.arrivalDate,
      departureDate: resource.departureDate
    }).subscribe(
      response => {
        // Handle successful confirmation if needed
        console.log('Confirmation response:', response);
      },
      error => {
        // Handle error if the confirmation fails
        console.error('Confirmation error:', error);
      }
    );

  }
  confirm2(resource: any) {
    const fromId = 'BOM.AIRPORT'; // Replace with your fromId value
    const toId = 'DEL.AIRPORT'; // Replace with your toId value

    const url = `http://localhost:8089/flights/getMinFlightPrice`;
    const params = {
      fromId: fromId,
      toId: toId,
      departDate: resource.departureDate,
      currencyCode: 'AED'
    };

    this.http.get<any>(url, { params }).subscribe(
      (response) => {
        this.resultData = response;
        console.log('Flight search result:', this.resultData);
        // Process the response data as needed
      },
      (error) => {
        console.error('Error occurred:', error);
        // Handle error responses
      }
    );
  }
}
<div class="result-container">
  <h2>Result Page</h2>
  <div class="result-info">
    <p><strong>Text:</strong> {{ resultData['@text'] }}</p>
    <p><strong>Confidence:</strong> {{ resultData['@confidence'] }}</p>
  </div>

  <div *ngIf="resultData.Resources && resultData.Resources.length > 0" class="resources">
    <h3>Resources</h3>
    <ul>
      <li *ngFor="let resource of resultData.Resources" class="resource-item">
        <p><strong>URI:</strong> {{ resource['@URI'] }}</p>
        <div>
          <label for="arrivalDate">Arrival Date:</label>
          <input type="date" id="arrivalDate" [(ngModel)]="resource.arrivalDate">
        </div>
        <div>
          <label for="departureDate">Departure Date:</label>
          <input type="date" id="departureDate" [(ngModel)]="resource.departureDate">
        </div>
        <button (click)="confirm(resource)">Confirm</button>
      </li>
    </ul>
  </div>
</div>
